import React, { useEffect, useState } from "react";
import { 
  getNotes, getArchivedNotes, createNote, updateNote, deleteNote, toggleArchive,
  getCategories, assignCategory, removeCategory 
} from "../services/api";
import NoteCard from "./NoteCard";
import NoteForm from "./NoteForm";

export default function NotesList() {
  const [notes, setNotes] = useState([]);
  const [categories, setCategories] = useState([]);
  const [filterCategory, setFilterCategory] = useState("");
  const [showArchived, setShowArchived] = useState(null); // null = no mostrar, true = archivadas, false = activas
  const [editingNote, setEditingNote] = useState(null);

  useEffect(() => {
    fetchCategories();
  }, []);

  async function fetchCategories() {
    try {
      const data = await getCategories();
      setCategories(data);
    } catch (err) {
      console.error(err);
    }
  }

  async function fetchNotes() {
    try {
      let data;
      if (showArchived === true) data = await getArchivedNotes();
      else if (showArchived === false) data = await getNotes();
      else data = [];
      setNotes(data);
    } catch (err) {
      console.error(err);
    }
  }

  useEffect(() => {
    if (showArchived !== null) fetchNotes();
  }, [showArchived]);

  const filteredNotes = filterCategory
    ? notes.filter(n => n.Categories?.some(c => c.ID === parseInt(filterCategory)))
    : notes;

  const handleSaveNote = async (note) => {
    try {
      let updated;
      if (note.ID) {
        updated = await updateNote(note.ID, { Title: note.Title, Content: note.Content });
        setNotes(notes.map(n => n.ID === updated.ID ? updated : n));
      } else {
        updated = await createNote({ Title: note.Title, Content: note.Content });
        setNotes([...notes, updated]);
      }
      setEditingNote(null);
    } catch (err) {
      console.error(err);
    }
  };

  const handleAssignCategory = async (noteId, categoryId) => {
    try {
      const updated = await assignCategory(noteId, categoryId);
      setNotes(notes.map(n => n.ID === updated.ID ? updated : n));
    } catch (err) { console.error(err); }
  };

  const handleRemoveCategory = async (noteId, categoryId) => {
    try {
      const updated = await removeCategory(noteId, categoryId);
      setNotes(notes.map(n => n.ID === updated.ID ? updated : n));
    } catch (err) { console.error(err); }
  };

  const handleArchive = async (id) => {
    try {
      const updated = await toggleArchive(id);
      setNotes(notes.map(n => n.ID === updated.ID ? updated : n));
    } catch (err) { console.error(err); }
  };

  const handleDelete = async (id) => {
    try {
      await deleteNote(id);
      setNotes(notes.filter(n => n.ID !== id));
    } catch (err) { console.error(err); }
  };

  return (
    <div style={{ marginBottom: "30px" }}>
      <h2>Notes</h2>
      <div style={{ marginBottom: "10px" }}>
        <button onClick={() => { setEditingNote({}); setShowArchived(false); }}>Create Note</button>
        <button onClick={() => setShowArchived(false)}>Active Notes</button>
        <button onClick={() => setShowArchived(true)}>Archived Notes</button>
        <select value={filterCategory} onChange={e => setFilterCategory(e.target.value)}>
          <option value="">All Categories</option>
          {categories.map(c => <option key={c.ID} value={c.ID}>{c.name}</option>)}
        </select>
      </div>

      {editingNote && (
        <NoteForm note={editingNote} onSave={handleSaveNote} onCancel={() => setEditingNote(null)} />
      )}

      {filteredNotes.map(note => (
        <NoteCard
          key={note.ID}
          note={note}
          categories={categories}
          onEdit={setEditingNote}
          onArchive={handleArchive}
          onDelete={handleDelete}
          onAssignCategory={handleAssignCategory}
          onRemoveCategory={handleRemoveCategory}
        />
      ))}
    </div>
  );
}
